import React from 'react'
import styled from 'styled-components'
import { Link } from 'react-router-dom'
import PageHero from '../components/PageHero'
const ApparelPage = () => {
    return (
        <main>
            <PageHero title='Apparel' />
            <Wrapper className='page section section-center'>

                <div id="myShop">
                    <a href="https://shop.spreadshirt.se/optimal-performance">optimal-performance</a>
                </div>

                <script>
                    var spread_shop_config = {[
                        shopName: 'optimal-performance',
                        locale: 'se_SE',
                        prefix: 'https://shop.spreadshirt.se',
                        baseId: 'myShop'
                    ]}
                </script>

                <script type="text/javascript"
                    src="https://shop.spreadshirt.se/shopfiles/shopclient/shopclient.nocache.js">
                </script>
            </Wrapper>
        </main>

    )
}

const Wrapper = styled.main`
display: grid;
gap: 4rem;
img {
  width: 100%;
  display: block;
  border-radius: var(--radius);
  height: 500px;
  object-fit: cover;
}
p {
  line-height: 2;
  max-width: 45em;
  margin: 0 auto;
  margin-top: 2rem;
  margin-bottom: 1rem;
  color: var(--clr-primary-10);
}
.title {
  text-align: left;
}
.underline {
  margin-left: 0;
}
@media (min-width: 992px) {
  grid-template-columns: 1fr 1fr;
}
`

export default ApparelPage
